import { Link } from "react-router-dom"
import posts from "../posts"

export default class Writings extends Component {
  show() {
    return (
      <writing>
        {posts.map(post => (
          <Link to={`/thoughts/${post.url}`}>{post.name}</Link>
        ))}
      </writing>
    )
  }

  styles = {
    writing: {
      marginTop: 20,
    },
    line: {
      display: "block",
    },
    b: {
      display: "inline",
      marginLeft: 3,
    },
  }
}
